    return(
        <div className="navi">
            <ul>
                <img src="/logo192.png" alt="Logo" /> {/* Fixed path and added alt */}
                <li><a href="#">Home</a></li>
                <li><a href="#">Ueber uns</a></li>
                <li><a href="#">Wettbewerbe</a></li>
